<p style="padding-left: 14pt;text-indent: 0pt;line-height: 113%;text-align: justify;">EL CONTRATISTA SE OBLIGA a prestarle de manera eficaz, responsabilidad en el servicio, garantizando eficiencia y cumplimiento <b>CLAUSULAS: SEGUNDO: OBLIGACIONES DEL CONTRATISTA: 2. SEGUROS: </b>Tomará por cuenta propia, una póliza de seguros de responsabilidad civil contractual y extracontractual que les ampare contra los riesgos inherentes a la actividad transportadora así: <b>2.1. </b>Póliza de responsabilidad civil contractual: muerte accidental, incapacidad total y permanente, incapacidad temporal, gastos médicos, amparo patrimonial, primeros auxilios, asistencia jurídica en proceso civil, accidentes personales <b>2.2. </b>Póliza de responsabilidad civil extracontractual: daños a bienes de terceros, muerte o lesiones a una persona, muerte o lesiones a dos o más personas, amparo patrimonial, asistencia jurídica en proceso civil y penal, Con lo anterior le damos cumplimiento al Artículo 17 Del Decreto 174 de 2001, razón por la que somos obligados a tomar las pólizas <b>2.3. </b>El Vehículo que el Contratista destine a la prestación de este servicio de transpone, debe cumplir con las condiciones Técnico Mecánicas, homologadas por el Ministerio de Transporte, y se relacionan, con identificación de Número de placa, marca, modelo y numero interno del vehículo, que se incorpora a este contrato <b>2.4. </b>El contratante dentro de su operación interna cuenta con los supervisores de vía que vigilarán el cumplimiento del recorrido. Y de esta manera solucionar a la mayor brevedad posible cualquier inconveniente que se presente. <b>CLAUSULAS: TERCERA: </b>El vehículo que preste el contratista a utilizar y solicitado por el contratante es: Placa <b>{{$fuec->vehiculo->placa}}</b>, Marca <b>{{$fuec->vehiculo->marca->nombre}}</b>, Modelo <b>{{$fuec->vehiculo->modelo}}</b>, Numero Interno <b>{{$fuec->vehiculo->codigo_interno}}</b>, Teléfono , Póliza de Seguro Obligatorio para Accidentes de Tránsito (SOAT) <b>No. {{$documentos[$fuec->vehiculo->placa][9]['numero']}}</b>, Vigente hasta el <b>{{$documentos[$fuec->vehiculo->placa][9]['fecha_vencimiento']}}</b>, Expedida por la Compañía de Seguros , Pólizas de la Empresa de Responsabilidad Civil Contractual y Extracontractual Vigente hasta el <b>{{$documentos[$fuec->vehiculo->placa][12]['fecha_vencimiento']}}</b>,

Expedida por la Compañía de Seguros , la capacidad del vehículo es de 
<b>{{$fuec->vehiculo->capacidad_pasajeros}} Pasajeros</b>, según la Tarjeta de Operación 
<b>No. {{$documentos[$fuec->vehiculo->placa][13]['numero']}}</b>, Vigente hasta el 
<b>{{$documentos[$fuec->vehiculo->placa][13]['fecha_vencimiento']}}</b>. 

Expedida por el Ministerio de Transporte, y Contratista o en su defecto a las empresas con la que se haya realizado acuerdos, convenio de colaboración empresarial o contrato con empresas de transporte automotor por carretera, de acuerdo al decreto 171 y 174 de 2001. <b>CLAUSULAS: CUARTA: </b>EL CONTRATISTA, será el único responsable de la póliza extracontractual, revisión técnico mecánica y gases , por estar legalmente vinculados a la empresa de transporte de los daños con su vehículo que se de origen a terceros, bien sea por daños materiales o lesiones a personas, y desde ahora manifiesta que habrá rotura del principio de solidaridad con la Contratante, razón por la que, únicamente responderá el contratista, quien para tal evento estará respaldado con el amparo de las Pólizas de Responsabilidad Civil contractual y extracontractual. 4.1. solo en caso que el contratante debe responder es en el evento que por uso de los pasajeros que se transportan en el vehículo tal como: daños en cojinería, vidrios, ventanas, lámina y pintura o elementos que le sean entregados en operación para su comodidad en el servicio en condición de recibido de los mismos <b>CLAUSULAS: QUINTA: </b>EL CONTRATISTA, podrá celebrar Convenio de Colaboración Empresarial. Con el objeto de posibilitar una eficiente racionalización en el uso del equipo automotor y la mejor prestación del servicio; de igual manera el Contratista podrá celebrar contratos con empresas de transporte colectivo en el evento de alta demanda, es de anotar que en los casos aquí citados son regulados por los artículos 24 y 25 de Decreto 174 de 2001. <b>CLAUSULAS: SEXTA: </b>PRECIO. Las partes libremente acuerdan como precio del contrato de transporte que se suscribe es de Pesos moneda corriente nacional, <b>CLAUSULAS: SÉPTIMA: </b>FORMA DE PAGO: Los pagos se cancelaran de acuerdo a lo pactado entre ambas partes. <b>CLAUSULAS: OCTAVA: </b>OBLIGACIONES DEL CONTRATANTE:</p><p style="padding-left: 14pt;text-indent: 0pt;line-height: 113%;text-align: justify;">8.1. Pagar el precio acordado del transporte 8.2. Acatar las condiciones de seguridad impuestas por el Contratista o Reglamentos oficiales 8.3. Supervisar el comportamiento y conservación del vehículo en las condiciones entregadas para el servicio 8.4. Tomar el vehículo en el día hora, y lugar convenido. <b>CLAUSULAS: NOVENA: </b>CAUSALES DE TERMINACIÓN: son causales de terminación 9.1. No cancelar el precio del transporte en el término acordado 9.2. No cumplir el contratista con las rutas y horarios señalados. 9.3. Incumplir cualquiera de las cláusulas aquí pactadas. <b>CLAUSULAS: DECIMA: </b>PENAL. las partes acuerdan que como cláusula penal fijan la suma del valor de Pago Del 10% del valor del contrato de transporte, que pagará la parte que incumpla el presente contrato a la parte cumplida. Para constancia de lo anterior se firma en BOGOTA, a los: {{$fechas[2]['dia']}} días del Mes: {{$fechas[2]['mes']}} del año: {{$fechas[2]['year']}}.</p><p style="text-indent: 0pt;text-align: left;"><br/></p>



